import React from 'react'

export default function Tasks({name, priority, difficulty, start_date, end_date, complete}) {
    return (
            <>
            <td>{name}</td>
            <td>{difficulty}</td>
            <td>{priority}</td>
            <td>{start_date}</td>
            <td>{end_date}</td>
            <td><input type="checkbox" name="complete" value="complete"></input></td>
        </>
    )
}
